import React, {Component} from 'react';

export default class CategoryCard extends Component {
    constructor(props){
        super(props);
    }
    render (){
        return (
            <div>
                <h2>{this.props.title}</h2>
                <img src={this.props.image}></img>
            </div>
        );
    }
}
